<!DOCTYPE html>
<html lang="vi">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
    <title>Bản đồ Trường Học TDTU</title>
    <style>
        /* 1. Reset mặc định */
        body, html { margin: 0; padding: 0; width: 100%; height: 100%; overflow: hidden; background: #f4f4f4; }
        
        /* 2. Container chứa bản đồ - Căn giữa màn hình */
        .map-wrapper {
            width: 100%;
            height: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        /* 3. CSS cho SVG - Responsive thần thánh */
        svg {
            width: 100%;       /* Chiếm hết chiều ngang điện thoại */
            height: auto;      /* Chiều cao tự tính */
            max-height: 100vh; /* Không vượt quá chiều cao màn hình */
            display: block;
        }

        /* 4. Tương tác (UX) */
        /* Các lớp này sẽ được gán vào SVG */
        .interactive-area {
            cursor: pointer;
            transition: all 0.3s ease; /* Hiệu ứng mượt */
            fill: #cccccc; /* Màu mặc định nếu trong SVG chưa tô */
        }
        
        .interactive-area:hover {
            fill: #ff6b6b !important; /* Đổi màu khi di chuột/chạm */
            stroke: #333;
            stroke-width: 2px;
        }
        
        .interactive-area:active {
            fill: #c92a2a !important; /* Màu khi đang nhấn xuống */
        }

        /* 5. Popup thông tin (Đơn giản, đẹp) */
        #info-popup {
            position: fixed;
            bottom: -100px; /* Giấu ở dưới */
            left: 5%;
            width: 90%;
            background: white;
            padding: 15px;
            border-radius: 12px;
            box-shadow: 0 4px 15px rgba(0,0,0,0.2);
            transition: bottom 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275);
            z-index: 100;
            box-sizing: border-box;
            text-align: center;
        }
        
        #info-popup h3 { margin: 0 0 5px 0; color: #333; }
        #info-popup p { margin: 0; color: #666; font-size: 14px; }
        
        /* Nút đóng popup */
        .close-btn {
            position: absolute; top: 5px; right: 10px; 
            font-size: 20px; color: #999; cursor: pointer;
        }
    </style>
</head>

    <script>
        // LOGIC XỬ LÝ
        
        // 1. Dữ liệu (Giả lập database)
        // Key phải trùng với ID bạn đặt trong file SVG
        const dataMap = {
            "toanhaA": { title: "Khu A - Hiệu Bộ", desc: "Phòng Công tác sinh viên, Phòng Đào tạo (Tầng 1)" },
            "thuvien": { title: "Thư Viện Trung Tâm", desc: "Giờ mở cửa: 7:30 - 21:00. Yêu cầu thẻ sinh viên." },
            "cantin":  { title: "Căn Tin", desc: "Phục vụ ăn trưa và nước uống." },
            "congchinh": { title: "Cổng Chính", desc: "Đường Nguyễn Văn Cừ." }
        };

        // 2. Hàm hiển thị Popup
        function showPopup(id) {
            const popup = document.getElementById('info-popup');
            const title = document.getElementById('popup-title');
            const desc = document.getElementById('popup-desc');
            
            if (dataMap[id]) {
                title.innerText = dataMap[id].title;
                desc.innerText = dataMap[id].desc;
                popup.style.bottom = "20px"; // Trượt lên
            }
        }

        // 3. Hàm đóng Popup
        function closePopup() {
            document.getElementById('info-popup').style.bottom = "-100px";
        }
    </script>
